syntax = "proto3";

package testdata;

option go_package = "github.com/wyy-go/wlib/testdata";
option java_multiple_files = true;
option java_package = "io.grpc.wlib.proc.testdata";
option java_outer_classname = "Registration";

message Registration {
  int64 id = 1;
  string open_id = 2;
  int64 expired_at = 3;
  string code = 4;
}